INSERT INTO produto 
(id, dt_cadastro,titulo,autor,ano_edicao,editora,edicao,isbn,numero_paginas,sinopse,codigo_barras,quantidade_estoque,valor,id_grupo_precificacao,id_dimensao,imagem) 
VALUES
(1, now(),'O Código da Vinci','Brown, Dan',2004,'Editora Arqueiro','2ª Edição','8575421131',432,'Um assassinato dentro do Museu do Louvre, em Paris, traz à tona uma sinistra conspiração para revelar um segredo que foi protegido por uma sociedade secreta desde os tempos de Jesus Cristo. A vítima é o respeitado curador do museu, Jacques Saunière, um dos líderes dessa antiga fraternidade, o Priorado de Sião, que já teve como membros Leonardo da Vinci, Victor Hugo e Isaac Newton. Momentos antes de morrer, Saunière deixa uma mensagem cifrada que apenas a criptógrafa Sophie Neveu e Robert Langdon, um simbologista, podem desvendar. Eles viram suspeitos e detetives enquanto tentam decifrar um intricado quebra-cabeças que pode lhes revelar um segredo milenar que envolve a Igreja Católica. Apenas alguns passos à frente das autoridades e do perigoso assassino, Sophie e Robert vão à procura de pistas ocultas nas obras de Da Vinci e se debruçam sobre alguns dos maiores mistérios da cultura ocidental - da natureza do sorriso da Mona Lisa ao significado do Santo Graal. Mesclando os ingredientes de um envolvente suspense com informações sobre obras de arte, documentos e rituais secretos, Dan Brown consagrou-se como um dos autores mais brilhantes da atualidade.','9788575421130',30,49.90,2,1,),
(2,now(),'Fortaleza Digital','Brown, Dan',2003,'Editora Arqueiro','3ª Edição','8599296205',320,'Antes de estourar no mundo inteiro com O código Da Vinci, Dan Brown já demonstrava um talento singular como contador de histórias no seu primeiro livro, Fortaleza digital, lançado em 1998 nos Estados Unidos. Muitos dos ingredientes que, anos depois, fariam com que o autor fosse reconhecido como um novo mestre dos livros de ação e suspense já estavam presentes no seu romance de estréia: a narrativa rápida, a trama repleta de reviravoltas que prendem o leitor da primeira à última página e o fascínio exercido por códigos secretos, criptografia e enigmas misteriosos. Em Fortaleza digital, Brown mergulha no intrigante universo dos serviços de informação e ambienta sua história na ultra-secreta e multibilionária NSA, a Agência de Segurança Nacional americana, mais poderosa do que a CIA ou qualquer outra organização de inteligência do mundo. Quando o supercomputador da NSA, até então considerado uma arma invencível para decodificar mensagens terroristas transmitidas pela Internet, se depara com um novo código que não pode ser quebrado, a agência recorre à sua mais brilhante criptógrafa, a bela matemática Susan Fletcher. Presa numa teia de segredos e mentiras, sem saber em quem confiar, Susan precisa encontrar a chave do engenhoso código para evitar o maior desastre da história da inteligência americana e para salvar a sua vida e a do homem que ama.','9788599296202',59,39.90,1,2,),
(3,now(),'O Pequeno Príncipe','de Saint-Exupery, Antoine',2013,'Casa dos Livros','48ª edição','9788522005239',94,'Apesar da presença explícita de dois personagens e do registro de um diálogo entre o aviador e uma criança, diversos aspectos autobiográficos estão presentes nesta narrativa, publicada pela primeira vez em 1945. Através de imagens simbólicas, as passagens de ordem temporal, na vida do autor, estão ali presentes: casamento/separação, profissões, sonhos, decepções. Os dois personagens tornam-se representações do próprio Saint-Exupéry, em um monólogo interior entre o "eu" e o "outro".','9788522005239',60,29.90,4,3,),
(4,now(),'O Iluminado','King, Stephen',2012,'Suma','1ª edição','8581050484',464,'O romance, magistralmente levado ao cinema por Stanley Kubrick, continua apaixonando (e aterrorizando) novas gerações de leitores. A luta assustadora entre dois mundos. Um menino e o desejo assassino de poderosas forças malignas. Uma família refém do mal. Nesta guerra sem testemunhas, vencerá o mais forte. Danny Torrance não é um menino comum. É capaz de ouvir pensamentos e transportar-se no tempo. Danny é iluminado. Será uma maldição ou uma bênção? A resposta pode estar guardada na imponência assustadora do hotel Overlook. Em O iluminado, quando Jack Torrance consegue o emprego de zelador no velho hotel, todos os problemas da família parecem estar solucionados. Não mais o desemprego e as noites de bebedeiras. Não mais o sofrimento da esposa, Wendy. Tranquilidade e ar puro para o pequeno Danny livrar-se das convulsões que assustam a família. Só que o Overlook não é um hotel comum. O tempo esqueceu-se de enterrar velhos ódios e de cicatrizar antigas feridas, e espíritos malignos ainda residem nos corredores. O hotel é uma chaga aberta de ressentimento e desejo de vingança. É uma sentença de morte. E somente os poderes de Danny podem fazer frente à disseminação do mal.','9788581050485',29,59.90,1,4,),
(5,now(),'Box Sherlock Holmes','Doyle, Arthur Conan',2019,'HarperCollins','1ª edição','8595080836',1808,'Em 1887, o escritor escocês sir Arthur Conan Doyle criou Sherlock Holmes, o infalível detetive a quem os agentes da Scotland Yard recorriam para solucionar os mistérios mais intrigantes da Inglaterra vitoriana. Desde então, as aventuras do mestre da investigação atraem leitores ávidos por chegar à última página e ver o enigma desvendado. Esta obra completa reúne os quatro romances e os 56 contos sobre as aventuras do detetive mais famoso do mundo e de seu fiel companheiro, o dr. Watson. Para desvendar mistérios, o faro e a astúcia de Sherlock Holmes levam às fontes menos óbvias, às informações mais precisas. Um modelo que influencia até hoje a literatura policial e revela fôlego para impressionar gerações de leitores através dos tempos.','9788595080836',20,89.90,2,5,),
(6,now(),'A divina comédia','Alighieri, Dante',2017,'Editora 34;','4ª edição','8595080836',696,'Texto fundador da língua italiana, súmula da cosmovisão de toda uma época, monumento poético de rigor e beleza, obra magna da literatura universal. É fato que a "Comédia" merece esses e muitos outros adjetivos de louvor, incluindo o "divina" que Boccaccio lhe deu já no século XIV. Mas também é certo que, como bom clássico, este livro reserva a cada novo leitor a prazerosa surpresa de renascer revigorado, como vem fazendo de geração em geração há quase setecentos anos. A longa jornada dantesca através do Inferno, Purgatório e Paraíso é aqui oferecida na íntegra - com seus mais de 14 mil decassílabos divididos em cem cantos e três partes - na rigorosa tradução de Italo Eugenio Mauro, vencedora do Prêmio Jabuti e celebrada por sua fidelidade à métrica e à rima originais. A edição traz ainda, como prefácio, um inspirado ensaio de Otto Maria Carpeaux.','9788595080836',40,69.90,4,6,),
(7,now(),'A revolução dos bichos','Orwell, George',2007,'Companhia das Letras','1ª edição','8535909559',152,'Escrita em plena Segunda Guerra Mundial e publicada em 1945 depois de ter sido rejeitada por várias editoras, essa pequena narrativa causou desconforto ao satirizar ferozmente a ditadura stalinista numa época em que os soviéticos ainda eram aliados do Ocidente na luta contra o eixo nazifascista. De fato, são claras as referências: o despótico Napoleão seria Stálin, o banido Bola-de-Neve seria Trotsky, e os eventos políticos - expurgos, instituição de um estado policial, deturpação tendenciosa da História - mimetizam os que estavam em curso na União Soviética. Com o acirramento da Guerra Fria, as mesmas razões que causaram constrangimento na época de sua publicação levaram A revolução dos bichos a ser amplamente usada pelo Ocidente nas décadas seguintes como arma ideológica contra o comunismo. O próprio Orwell, adepto do socialismo e inimigo de qualquer forma de manipulação política, sentiu-se incomodado com a utilização de sua fábula como panfleto. Depois das profundas transformações políticas que mudaram a fisionomia do planeta nas últimas décadas, a pequena obra-prima de Orwell pode ser vista sem o viés ideológico reducionista. Mais de sessenta anos depois de escrita, ela mantém o viço e o brilho de uma alegoria perene sobre as fraquezas humanas que levam à corrosão dos grandes projetos de revolução política. É irônico que o escritor, para fazer esse retrato cruel da humanidade, tenha recorrido aos animais como personagens. De certo modo, a inteligência política que humaniza seus bichos é a mesma que animaliza os homens. Escrito com perfeito domínio da narrativa, atenção às minúcias e extraordinária capacidade de criação de personagens e situações, A revolução dos bichos combina de maneira feliz duas ricas tradições literárias: a das fábulas morais, que remontam a Esopo, e a da sátira política, que teve talvez em Jonathan Swift seu representante máximo. "A melhor sátira já escrita sobre a face negra da história moderna." Malcolm Bradbury "Um livro para todos os tipos de leitor, seu brilho ainda intacto depois de sessenta anos." Ruth Rendell','9788535909555',19,35.90,4,7,);
